// Fetch tournament data from the database
$tournament = mysqli_query($conn, "SELECT * FROM tournament");

if ($tournament !== false && mysqli_num_rows($tournament) > 0) {
    while ($tournamentItem = mysqli_fetch_assoc($tournament)) {
        // Construct image paths for logo_1 and logo_2
        $logo_1_path = '../admin/uploads/' . $tournamentItem['logo_1'];
        $logo_2_path = '../admin/uploads/' . $tournamentItem['logo_2'];

        // Check if the image files exist
        if (!file_exists($logo_1_path) || !file_exists($logo_2_path)) {
            // Handle case where image file(s) do not exist
            // For example, set default image paths or skip rendering
            $logo_1_path = 'path_to_default_image_1.jpg';
            $logo_2_path = 'path_to_default_image_2.jpg';
        }
?>
